//회원가입과 로그인폼 컴포넌트
import React from 'react';
import styled from 'styled-components';

const AuthFormBlock = styled.div``;

const StyledInput = styled.input``;

const Footer = styled.div``;

const AuthForm = () => {
  return (
    <AuthFormBlock>
      <h3>로그인</h3>
      <form>
        <StyledInput
          autoComplete="username"
          name="username"
          placeholder="아이디"
        />
      </form>
    </AuthFormBlock>
  );
};

export default AuthForm;
